import React from 'react';

function RegionCard({ region }) {
    return (
        <div className='region-card'>
            <h6>{region.region}</h6>
            { region.languages.map(language => <a href={language.link}>{language.language}</a>) }
        </div>
    );
}

export default RegionCard;
